window.addEventListener('mousemove', (e) => {
    m_x = e.clientX
    m_y = e.clientY
})

window.addEventListener('click', (e) => {
    let x = e.clientX
    let y = e.clientY
    //this bit is velocity related
    cx=x
    cy=y
    if(fly_is && bx-10 <= x && x <= bx+15 && by-10 <= y && y <= by+15){
        clearInterval(sId);
        killFly()
    }
})

async function killFly(){
    fly_is= 0
    kill_total++
    ctx.fillStyle='red'
    ctx.fillRect(bx,by,10,10)
    ctx.fillStyle='red'
    ctx.fillRect(bx-5,by-5,5,5)
    ctx.fillStyle='red'
    ctx.fillRect(bx+10,by-5,5,5)

    await new Promise((resolve) =>{
        setTimeout(()=>{resolve()},100)
    })

    ctx.fillStyle='rgb(189, 187, 187)'
    ctx.fillRect(bx,by,10,10)
    ctx.fillStyle='rgb(189, 187, 187)'
    ctx.fillRect(bx-5,by-5,5,5)
    ctx.fillStyle='rgb(189, 187, 187)'
    ctx.fillRect(bx+10,by-5,5,5)


    ctx.fillStyle='red'
    ctx.fillRect(bx-3,by-3,5,5)
    ctx.fillStyle='red'
    ctx.fillRect(bx+3,by+3,5,5)
    ctx.fillStyle='red'
    ctx.fillRect(bx-7,by-7,5,5)
    ctx.fillStyle='red'
    ctx.fillRect(bx+12,by-7,5,5)
    await new Promise((resolve) =>{
        setTimeout(()=>{resolve()},100)
    })

    ctx.fillStyle='rgb(189, 187, 187)'
    ctx.fillRect(bx-3,by-3,5,5)
    ctx.fillStyle='rgb(189, 187, 187)'
    ctx.fillRect(bx+3,by+3,5,5)
    ctx.fillStyle='rgb(189, 187, 187)'
    ctx.fillRect(bx-7,by-7,5,5)
    ctx.fillStyle='rgb(189, 187, 187)'
    ctx.fillRect(bx+12,by-7,5,5)
}

