function l33t(){
    function drawBg(){
        ctx.fillStyle = "black"
        ctx.fillRect(0,0,w,h)
    }

    let row = []

    function matrix(){
        row = []
        for(let i=0;i<(w/5);i++){
            let odd = Math.floor(Math.random()*50)
            if(odd >= 47){
                row.push(1)
            }
            else{
                row.push(0)
            }
        }
    }

    let j = 0
    function drawMat(){
        matrix()
        let i = 0;
        for(s of row){
            let y = j%(h/5)
            if(s == 1){
                ctx.fillStyle='rgb(66, 245, 105)'
                ctx.fillRect(i*5,y*5,5,5)
            }else{
                ctx.fillStyle='black'
                ctx.fillRect(i*5,y*5,5,5)
            }
            i++
        }
        j++
    }


    drawBg()
    setInterval(drawMat, 100)
}

let vel = 0
let cx = 0
let cy = 0
let dx = 0
let dy = 0
function velocity(){
    vel = Math.sqrt((m_x - cx)**2 + (m_y - cy)**2)
    dx = m_x - cx
    dy = m_y - cy
    cx = m_x
    cy = m_y
}

setInterval(() =>{
    velocity()
},100)

let f_x
let f_y

let i = 0 

let new_img = []

function rotation(){
    new_img = new Array(img_bit.length).fill(0)
    let tetha 
    if(dx > 0 && dy > 0){
        tetha = Math.PI - Math.atan(dy/dx)
    }else if(dx < 0 && dy > 0){
        tetha = Math.atan(dy/-dx)
    }else if(dx > 0 && dy < 0){
        tetha = Math.PI + Math.atan(-dy/dx)
    }else if(dx < 0 && dy < 0){
        tetha = 2*Math.PI - Math.atan(dy/dx)
    }
    let i_h = [Math.cos(tetha),Math.sin(tetha)]
    let j_h = [-Math.sin(tetha),Math.cos(tetha)]

    for(let i=0;i<img_bit.length;i++){
        if(img_bit[i] == 1){
            x = i%100 - 50
            y = -(Math.floor(i/100) - 50)

            new_x = Math.floor((i_h[0] * x + j_h[0] * y) + 50)
            new_y = Math.floor(-((i_h[1] * x + j_h[1] * y) - 50))
            
            new_img[new_y*100 + new_x] = 1
        }
    }

    let new_arr = new_img.slice()
    return new_arr
}


let launching = 0
function fire(e){
    if(vel >= 0 && e.buttons == 1){
        launching = 1
        rotation()
        ctx.fillStyle='rgb(189, 187, 187)'
        ctx.fillRect(f_x,f_y,100,100)
        let imgdata = ctx.createImageData(100,100)
        for(let i = 0;i<new_img.length;i++){
            if(new_img[i] == 1){
                imgdata.data[i*4] = 242
                imgdata.data[i*4+1] = 60
                imgdata.data[i*4+2] = 8
                imgdata.data[i*4+3] = 255
            }
        }
        ctx.putImageData(imgdata,m_x-50,m_y-50)
        f_x = m_x-50
        f_y = m_y-50
    }else if(launching == 1){
        launching = 0
        l_x = dx
        l_y = dy
        s_x = m_x
        s_y = m_y
        clear_prev_fire()
        clearInterval(int_l)
        base = 20
        int_l = setInterval(launch, 100)
    
    }else{
        ctx.fillStyle='rgb(189, 187, 187)'
        ctx.fillRect(f_x,f_y,100,100)
    }
}

let int_l
let s_x = 0
let s_y = 0
let l_x = 10
let l_y = 10
let base = 20

function clear_prev_fire(){
    ctx.fillStyle='rgb(189, 187, 187)'
    ctx.fillRect(s_x+(20-base)*l_x,s_y+(20-base)*l_y,100,100)
}
function launch(){
    clear_prev_fire()
    let imgdata = ctx.createImageData(100,100)
    for(let i = 0;i<new_img.length;i++){
        if(new_img[i] == 1){
            imgdata.data[i*4] = 242
            imgdata.data[i*4+1] = 60
            imgdata.data[i*4+2] = 8
            imgdata.data[i*4+3] = 255
        }
    }

    let hit_x = s_x+(20-base)*l_x
    let hit_y = s_y+(20-base)*l_y

    if(fly_is && hit_x-40 <= bx && bx <= hit_x+35 && hit_y-50 <= by && by <= hit_y+55){
        console.log("hit fly")
        clearInterval(sId);
        killFly()
    }
    base --
    ctx.putImageData(imgdata,s_x+(20-base)*l_x,s_y+(20-base)*l_y)
    if(base == 0){
        base = 20
        clearInterval(int_l)
    }
}

function startFire(){
    window.addEventListener("mousemove", fire)
}
